  false,\n\t\"url\": null,\n\t\"notes\": \"This paper is a two-dimensional numerical
  model study andncomparison of the polar dipole-dipole and Schlumberger resistivitynarrays.
  A catalog of dipole-dipole and Schlumberger apparentnresistivity pseudo-sections
  is presented. It is concluded that: fornthe Schlumberger array, data can be accurately
  interpreted only if the resistivity structure is horizontally layered, and conductive
  bodies having a depth of burial greater than their width are not observed; for the
  dipole-dipole array, complex anomaly patterns unrelated in appearance to the causative
  structure result from simple models, hence, a familiarity with model results is
  essential to interpretation of these data.\",\n\t\"license_title\": null,\n\t\"extras\":
